PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE courses (
	id INTEGER NOT NULL, 
	course_id VARCHAR(100) NOT NULL, 
	professor VARCHAR(100) NOT NULL, 
	week_name VARCHAR(50) NOT NULL, 
	day VARCHAR(20) NOT NULL, 
	start_time VARCHAR(10) NOT NULL, 
	end_time VARCHAR(10) NOT NULL, 
	duration_hours FLOAT NOT NULL, 
	raw_time_slot VARCHAR(50), 
	course_type VARCHAR(100) NOT NULL, 
	nb_students VARCHAR(20), 
	assigned_room VARCHAR(50), 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE rooms (
	id INTEGER NOT NULL, 
	room_id VARCHAR(50) NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	capacity INTEGER, 
	created_at DATETIME, 
	PRIMARY KEY (id), 
	UNIQUE (room_id)
);
CREATE TABLE professors (
	id INTEGER NOT NULL, 
	name VARCHAR(100) NOT NULL, 
	color VARCHAR(7), 
	working_days TEXT, 
	created_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE custom_courses (
	id INTEGER NOT NULL, 
	course_id VARCHAR(100) NOT NULL, 
	professor VARCHAR(100) NOT NULL, 
	week_name VARCHAR(50) NOT NULL, 
	day VARCHAR(20) NOT NULL, 
	start_time VARCHAR(10) NOT NULL, 
	end_time VARCHAR(10) NOT NULL, 
	duration_hours FLOAT NOT NULL, 
	raw_time_slot VARCHAR(50), 
	course_type VARCHAR(100) NOT NULL, 
	nb_students VARCHAR(20), 
	assigned_room VARCHAR(50), 
	created_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE TABLE tp_names (
	id INTEGER NOT NULL, 
	course_id VARCHAR(100) NOT NULL, 
	tp_name VARCHAR(200) NOT NULL, 
	created_at DATETIME, 
	updated_at DATETIME, 
	PRIMARY KEY (id)
);
CREATE INDEX ix_courses_professor ON courses (professor);
CREATE UNIQUE INDEX ix_courses_course_id ON courses (course_id);
CREATE INDEX idx_prof_week ON courses (professor, week_name);
CREATE INDEX idx_week_day ON courses (week_name, day);
CREATE INDEX idx_room_week_day ON courses (assigned_room, week_name, day);
CREATE INDEX ix_courses_assigned_room ON courses (assigned_room);
CREATE INDEX ix_courses_day ON courses (day);
CREATE INDEX idx_week_day_time ON courses (week_name, day, start_time);
CREATE INDEX idx_occupied_rooms ON courses (week_name, day, assigned_room, start_time, end_time);
CREATE INDEX ix_courses_week_name ON courses (week_name);
CREATE UNIQUE INDEX ix_professors_name ON professors (name);
CREATE INDEX ix_custom_courses_professor ON custom_courses (professor);
CREATE UNIQUE INDEX ix_custom_courses_course_id ON custom_courses (course_id);
CREATE INDEX ix_custom_courses_week_name ON custom_courses (week_name);
CREATE INDEX ix_custom_courses_day ON custom_courses (day);
CREATE UNIQUE INDEX ix_tp_names_course_id ON tp_names (course_id);
COMMIT;
